function removeFadeOut(a,b){const c=b/1e3;a.style.transition=`opacity ${c} s ease`;a.style.opacity=0;setTimeout(()=>{a.parentNode.removeChild(a)},b)}function set_loading_message(d){const e=document.getElementById("loading-text");e.innerHTML=d;console.log(d)}async function dense(f,g={}){const h=g.data_url||"data/dense_modules.json";const i=g.columns||4;const j=g.element_id||"dense_tables";const k=g.classes||"square";let l={};set_loading_message("Downloading dense modules...");await fetch(h).then(p=>p.json()).then(q=>{l=q});const m=l.length;const n=document.getElementById(j);let o=document.createElement("tr");for(let r=0;r<m;r++){if(r%i===0&&r!==0){n.appendChild(o);o=document.createElement("tr")}const s=document.createElement("div");s.className=k;s.id=`cluster_${r+1}`;o.appendChild(s)}n.appendChild(o);for(let t=0;t<m;t++){set_loading_message(`Loading ${t+1} of ${m} dense modules...`);setTimeout(()=>{create_dense_dag(f,`cluster_${t+1}`,l[t].name,l[t].data.nodes,l[t].data.edges)},0)}set_loading_message("Done!");removeFadeOut(document.getElementById("loading"),3e3)}function create_dense_dag(u,v,w,x,y){function z(){const F=document.getElementById(v).offsetWidth;const G=document.getElementById(v).offsetHeight;let H=Math.round(Math.sqrt(F*F+G*G)/(40+Math.log(x.length)));H=Math.min(H,20);return H}function A(){const I=document.getElementById(v).offsetWidth;const J=document.getElementById(v).offsetHeight;let K=Math.round(Math.sqrt(I*I+J*J)/(12+Math.log(x.length)));K=Math.min(K,60);return K}function B(){const L=document.getElementById(v).offsetWidth;const M=document.getElementById(v).offsetHeight;let N=Math.round(Math.sqrt(L*L+M*M)/(.75+Math.log(x.length)));N=Math.min(N,300);return N}const C=document.getElementById(v);const D=u.init(C);const E={title:{text:w,left:"center",textStyle:{fontSize:z()+10,fontWeight:"bolder",color:"#333"}},tooltip:{trigger:"item",triggerOn:"mousemove",formatter:"{b}",backgroundColor:"#F6F8FC",borderColor:"#8C8D8E",borderWidth:1,padding:[3,3,3,3],textStyle:{color:"#4C5058",fontSize:z()}},series:[{type:"graph",name:`Clique ${w}`,draggable:false,layout:"force",nodes:x,links:y,coordinateSystem:null,roam:true,symbolSize:A(),label:{show:true,position:"inside",fontSize:z(),padding:[3,3,3,3],verticalAlign:"middle",color:"#4C5058",backgroundColor:"#F6F8FC",borderColor:"#8C8D8E",borderWidth:1,borderRadius:4},force:{repulsion:300,edgeLength:B(),friction:.05,initLayout:"circular",layoutAnimation:false},lineStyle:{width:y.length<100?1:.5},emphasis:{focus:"none",itemStyle:{borderColor:"#000",borderWidth:2,color:"#FFA505"}}}]};E&&D.setOption(E);window.addEventListener("resize",()=>{D.resize();D.setOption({series:{label:{textStyle:{fontSize:z()}},symbolSize:A(),force:{edgeLength:B()}}})});return D}function dense_svg(O={}){const P=281;const Q=O.columns||5;const R=O.element_id||"dense_tables";const S=O.classes||"square";const T=O.image_count||P;const U=document.getElementById(R);let V=document.createElement("tr");const W=[];if(T!==P){for(let Z=0;Z<P;Z++){W.push(Z)}function X(){const $=Math.floor(Math.random()*W.length);return W.splice($,1)[0]}const Y=[];for(let _=0;_<T;_++){Y.push(X())}Y.sort((aa,ba)=>aa-ba);for(let ca=0;ca<T;ca++){if(ca%Q===0&&ca!==0){U.appendChild(V);V=document.createElement("tr")}const da=document.createElement("img");const ea=Y[ca];da.className=S;da.id=`cluster_${ca}`;da.src=`data/svg/C${ea+1}.svg`;V.appendChild(da)}U.appendChild(V);set_loading_message("Done!");removeFadeOut(document.getElementById("loading"),3e3)}else{for(let fa=0;fa<P;fa++){if(fa%Q===0&&fa!==0){U.appendChild(V);V=document.createElement("tr")}const ga=document.createElement("img");ga.className=S;ga.id=`cluster_${fa+1}`;ga.src=`data/svg/C${fa+1}.svg`;V.appendChild(ga)}U.appendChild(V);set_loading_message("Done!");removeFadeOut(document.getElementById("loading"),3e3)}}